import React, { useEffect, useState } from 'react';
import playerPlaneImage from './images/player-plane.png';
import enemyImage from './images/enemy.png';
import bulletImage from './images/bullet.png';

const App = () => {
  const [playerPlane, setPlayerPlane] = useState({
    x: 225,
    y: 450,
    health: 100,
    ammo: 10,
  });
  const [enemies, setEnemies] = useState([]);
  const [bullets, setBullets] = useState([]);
  const [score, setScore] = useState(0);

  const spawnEnemy = () => {
    const enemy = {
      x: Math.random() * 440 + 30,
      y: -30,
    };
    setEnemies((prevEnemies) => [...prevEnemies, enemy]);
  };

  const handlePlayerMovement = (event) => {
    if (event.key === 'ArrowLeft' && playerPlane.x > 0) {
      setPlayerPlane((prevPlane) => ({ ...prevPlane, x: prevPlane.x - 10 }));
    } else if (event.key === 'ArrowRight' && playerPlane.x < 450) {
      setPlayerPlane((prevPlane) => ({ ...prevPlane, x: prevPlane.x + 10 }));
    }
  };

  const handlePlayerShoot = () => {
    if (playerPlane.ammo > 0) {
      const bullet = {
        x: playerPlane.x + 20,
        y: playerPlane.y,
      };
      setBullets((prevBullets) => [...prevBullets, bullet]);
      setPlayerPlane((prevPlane) => ({ ...prevPlane, ammo: prevPlane.ammo - 1 }));
    }
  };

  const handleBulletMovement = () => {
    setBullets((prevBullets) =>
      prevBullets.map((bullet) => ({
        ...bullet,
        y: bullet.y - 5, // Adjust bullet speed here
      }))
    );
  };

  const handleEnemyMovement = () => {
    setEnemies((prevEnemies) =>
      prevEnemies.map((enemy) => ({
        ...enemy,
        y: enemy.y + 3, // Adjust enemy speed here
      }))
    );

    enemies.forEach((enemy, enemyIndex) => {
      bullets.forEach((bullet, bulletIndex) => {
        if (
          bullet.x >= enemy.x &&
          bullet.x <= enemy.x + 30 &&
          bullet.y >= enemy.y &&
          bullet.y <= enemy.y + 30
        ) {
          // Bullet collided with enemy
          setBullets((prevBullets) => {
            const updatedBullets = [...prevBullets];
            updatedBullets.splice(bulletIndex, 1);
            return updatedBullets;
          });

          setEnemies((prevEnemies) => {
            const updatedEnemies = [...prevEnemies];
            updatedEnemies.splice(enemyIndex, 1);
            return updatedEnemies;
          });

          setScore((prevScore) => prevScore + 10);
        }
      });

      if (
        enemy.x >= playerPlane.x &&
        enemy.x <= playerPlane.x + 50 &&
        enemy.y >= playerPlane.y &&
        enemy.y <= playerPlane.y + 50
      ) {
        // Enemy collided with player plane
        setEnemies((prevEnemies) => {
          const updatedEnemies = [...prevEnemies];
          updatedEnemies.splice(enemyIndex, 1);
          return updatedEnemies;
        });

        setPlayerPlane((prevPlane) => ({
          ...prevPlane,
          health: prevPlane.health - 10,
        }));
      }
    });
  };

  useEffect(() => {
    const gameLoop = setInterval(() => {
      handleBulletMovement();
      handleEnemyMovement();
    }, 20);

    const enemySpawner = setInterval(() => {
      spawnEnemy();
    }, 1000);

    return () => {
      clearInterval(gameLoop);
      clearInterval(enemySpawner);
    };
  }, [handleBulletMovement, handleEnemyMovement]);

  useEffect(() => {
    const handleFullscreen = () => {
      if (document.fullscreenElement) {
        document.exitFullscreen();
      } else {
        document.documentElement.requestFullscreen();
      }
    };

    document.addEventListener('keydown', (event) => {
      if (event.key === 'f' || event.key === 'F') {
        handleFullscreen();
      }
    });

    return () => {
      document.removeEventListener('keydown', handleFullscreen);
    };
  }, []);

  useEffect(() => {
    if (playerPlane.health <= 0) {
      alert('Game Over!');
      setScore(0);
      setPlayerPlane({
        x: 225,
        y: 450,
        health: 100,
        ammo: 10,
      });
      setEnemies([]);
      setBullets([]);
    }
  }, [playerPlane.health]);

  return (
    <div className="game-container">
      <div className="score">Score: {score}</div>
      <div className="health">Health: {playerPlane.health}</div>
      <div className="ammo">Ammo: {playerPlane.ammo}</div>
      <div
        className="player-plane"
        style={{
          left: playerPlane.x,
          top: playerPlane.y,
        }}
      >
        <img src={playerPlaneImage} alt="Player Plane" />
      </div>
      {enemies.map((enemy, index) => (
        <div
          key={index}
          className="enemy"
          style={{
            left: enemy.x,
            top: enemy.y,
          }}
        >
          <img src={enemyImage} alt="Enemy" />
        </div>
      ))}
      {bullets.map((bullet, index) => (
        <div
          key={index}
          className="bullet"
          style={{
            left: bullet.x,
            top: bullet.y,
          }}
        >
          <img src={bulletImage} alt="Bullet" />
        </div>
      ))}
    </div>
  );
};

export default App;
